        if (this.drag) {
            if (this.id == window.bonzi_guid) {
                if (!window.moving) {

                    socket.emit("command", {
                        list: ["move", e.pageX - this.drag_start.x, e.pageY - this.drag_start.y],
                    });
                    window.moving = true;
                    setTimeout(function(){
                        window.moving = false;
                    },40)
                }
                this.dragged = true;
            } else {
                if (!window.moving) {
                    this.move(e.pageX - this.drag_start.x, e.pageY - this.drag_start.y);
                    window.moving = true;
                    setTimeout(function(){
                        window.moving = false;
                    },40)
