    updateAnim() {
        if (this.event.timer === 0) this.sprite.gotoAndPlay(this.event.cur().anim);
        this.event.timer++;
        AgentHandler.needsUpdate = true;
        if (this.event.timer >= this.event.cur().ticks) this.eventNext();
    }

