            // Draw bullet
            ctx.fillStyle = "cyan";
            ctx.beginPath();
            ctx.arc(b.x, b.y, b.size / 2, 0, Math.PI * 2);
            ctx.fill();

            // Boss collision
            if (
                b.x > evilX && b.x < evilX + 256 &&
                b.y > evilY && b.y < evilY + 256 &&
                !spellCardActive
            ) {
                bullets.splice(i, 1);
                bossHP--;

                if (bossHP <= 0 && !spellCardActive) {
                    spellCardActive = true;
                    startSpellCard();
                }

                continue;
            }

            // Out of bounds
            if (b.y < -20) bullets.splice(i, 1);
        }
        requestAnimationFrame(update);
    }
