                agent.playbackRate = 1;
                if (agent.audio) {
                    agent.audio.playbackRate = agent.playbackRate || 1;
                    agent.audio.preservesPitch = false;
                }

    });
    socket.on("smite", () => {
        var audio = new Audio("./smite.mp3");
        audio.play();
        const originalScale = {};
        const originalPitch = {};

