body,
html {
    margin: 0;
    padding: 0;
    font-size: 16px;
}

body,
body * {
    font-family: "Comic Sans MS", sans-serif;
}

input[type="text"] {
    background-color: #fff;
    border: 1px inset #AAA;
    color: #000;
}

.xp_bubble,
#content {
    position: relative;
    background: #9fa2ff;
    color: #000;
    -webkit-border-radius: 9px;
    -moz-border-radius: 9px;
    border-radius: 9px;
    border: #000000 solid 1px;
}

#rss {
    position: absolute;
    top: 16px;
    right: 16px;
}

@font-face {
    font-family: 'Tahoma';
    src: url("font/Tahoma/Tahoma.eot#iefix") format("embedded-opentype"), url("font/Tahoma/Tahoma.woff") format("woff"), url("font/Tahoma/Tahoma.ttf") format("truetype"), url("font/Tahoma/Tahoma.svg#Tahoma") format("svg");
    font-weight: normal;
    font-style: normal;
}

html {
    overflow-y: auto;
}

body {
    background-color: #334ca0;
    background-image: url("../img/desktop/logothing.gif");
    background-position: center;
    background-repeat: no-repeat;
    background-attachment: fixed;
}

#content {
    width: 75%;
    max-width: 800px;
    margin: 32px auto;
    padding: 16px 32px;
    background-color: rgb(225 231 255 / 80%);
}

#bonziworld {
    display: none;
}

#titlebar {
    background-color: rgba(109, 51, 160, 0.85);
}

gay-big {
    font-size: 1.5em;
}

gay-spoiler {
    background-color: darkslategrey;
    border-radius: 3px;
    color: transparent;
    user-select: none;
    transition: background-color 0.2s, color 0.2s;
    cursor: pointer;
}

gay-spoiler:hover {
    background-color: #777;
}

gay-spoiler.reveal {
    background-color: #5555;
    color: black;
    user-select: all;
    cursor: auto;
}

gay-rainbow {
    background-image: linear-gradient(120deg in hsl longer hue, red, red, red);
    background-size: 500px;
    background-clip: text;
    color: transparent;
    animation: move 2s linear infinite;
}

gay-code {
    border: 1px solid #bbb;
    background-color: #ddd;
    border-radius: 4px;
    font: monospace;
    padding: 0 0.2em;
}

@keyframes move {
    from {
        background-position-x: 500px;
    }
    to {
        background-position-x: 0;
    }
}

